import styled from "styled-components";
import estilete from "../../images/estilete.png"

const Estilete = styled.div`

    margin-right: 0;
    margin-left: 0;
    margin-top: 0;
    margin-botton: 0; 

`;

const DivisaoImg = styled.img`

    display: flex;
    padding: 0 130px;
    margin-right: 0px;
    margin-top: 50px;
    width: 724px;
    height: 599px;

`;

function Divisao (){

    return (

        <Estilete>
            <img src={estilete} alt="estilete"></img>
        </Estilete>

    )

}

export default Divisao;
